export const styled = (theme) => ({
  root: {
    "& > *": {
      margin: theme.spacing(1),
    },
    textAlign: "center",
  },
  textFiled: {
    width: "100%",
  },
  textIntro: {
    fontSize: "35px",
    margin: "10px 0",
    color: "black",
    textAlign: "center",
    fontWeight: "600",
  },
});
